  LineShareButton,
  LinkedinShareButton,

  TwitterShareButton,

  WhatsappShareButton,

} from "react-share";
import {

  FacebookIcon,



  LinkedinIcon,


  TwitterIcon,

  WhatsappIcon,

} from "react-share";














const FooterPage = () => {
  return (
    <div    style={{backgroundColor: 'lightblue', height: '300px'}}>


    < TwitterShareButton    url={'https://twitter.com/'}  title={'fallow'}  >  




          <TwitterIcon size={32} round={true} />  </ TwitterShareButton> 


          <Container>
  <Row>
    <Col xs={{ order: 'last' }}>First, but last</Col>
    <Col xs>Second, but unordered</Col>
    <Col xs={{ order: 'first' }}>Third, but first</Col>
  </Row>
</Container>









      </div>

  );
}

export default FooterPage;
